import React, {useState} from 'react'
import { Link } from 'react-router-dom';
import logo from '../../assets/logo.png';
import { FaBars, FaTimes} from 'react-icons/fa';

import "./Navbar.css";


export default function Navbar() {
  const [nav, setNav] = useState(false)
  const handleNav = () => setNav(!nav)

  return (
    <div className="navbar">
       <div className="container">
        <div>
          <img src={logo} alt="logo" width={60}></img>
        </div>
    <ul className={nav ? 'nav-menu active' : 'nav-menu'} >
      <li>
        <Link exact to="/" style={{textDecoration: 'none'}}>Home</Link>
      </li>
      <li>
        <Link exact to="/nosotros">Nosotros</Link>
      </li>
      <li>
        <Link exact to="/servicios">Servicios</Link>
      </li>
      <li>
        <Link exact to="/valores">Valores</Link>
      </li>
      <li>
        <Link exact to="/contacto">Contacto</Link>
      </li>
    </ul>

    <div className='hamburger' onClick={handleNav}>
    {nav ? (
            <FaTimes size={20} style={{ color: "#ffffff" }} />
          ) : (
            <FaBars size={20} />
          )}
    </div>
    </div>
    </div>

  )
}
